import React, { useRef } from 'react';
import emailjs from '@emailjs/browser';
import "./contacto.css";

export default function Contacto() {
    const form = useRef();

    const sendEmail = (e) => {
        e.preventDefault();

        emailjs.sendForm('YOUR_SERVICE_ID', 'YOUR_TEMPLATE_ID', form.current, 'YOUR_PUBLIC_KEY')
            .then((result) => {
                console.log(result.text);
            }, (error) => {
                console.log(error.text);
            });
    };

    return (
        <div className="contacto">
              <span className="loginTitle">Cont√°ctanos</span>

        <form className="contactForm" ref={form} onSubmit={sendEmail}>
            <label>Nombre</label>
            <input className="contactInput" type="text" name="user_name" />
            <label>Email</label>
            <input className="contactInput" type="email" name="user_email" />
            <label>Mensaje</label>
            <textarea  className="contactMessage"  name="message" />
            <input  className="contactInput" type="submit" value="Send" />
        </form>
        </div>
    );
}
